  false,\n\t\"url\": null,\n\t\"notes\": \"TASK NAME: Elwha River, WA LiDAR LiDAR
  Data Acquisition and Processing Production Task USGS Contract No. G10PC00057 Task
  Order No. G11PD01088 Woolpert Order No. 71910 CONTRACTOR: Woolpert, Inc. LiDAR data
  is a remotely sensed high resolution elevation data collected by an airborne platform.
  The LiDAR sensor uses a combination of laser range finding, GPS positioning, and
  inertial measurement technologies. The LiDAR systems collect data point clouds that
  are used to produce highly detailed Digital Elevation Models (DEMs) of the earth's
  terrain, man-made structures, and vegetation. The task required the LiDAR data to
  be collected at a nominal pulse spacing (NPS) of 1.0 meter. The final products include
  first, last, and at least one intermediate return LAS, full classified LAS and one
  (1) meter pixel raster DEMs of the bare-earth surface in ERDAS IMG Format.The task
  order consisted of approximately thirty-five (35) square mile area along the Elwha
  River in Washington. This data will be used to assist the Department of Interior
  with the Elwha River Restoration Project following the removal of the Elwha Dam.
  The LiDAR data was acquired on October 10, 15, 16, and 17, 2012.\",\n\t\"license_title\":
